import React, { useContext, useState } from 'react'
import axios from "axios"
import { AuthContext } from '../authContext';
import "../styles/create.css"
import { useNavigate } from 'react-router-dom';
import Navbar from '../components/Navbar';
import { faPlusCircle } from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

const Create = () => {
    const navigate = useNavigate();
    const { user } = useContext(AuthContext);
    const [files, setFiles] = useState("");
    const [info, setInfo] = useState({});

    const handleChange = (e) => {
        setInfo((prev) => {
            const newInfo = { ...prev, [e.target.id]: e.target.value };
            return newInfo;
        });
    }

    const handleClick = async (e) => {
        e.preventDefault();
        let newEntry;

        try {
            let list = [];

            if (files && files.length > 0) {
                list = await Promise.all(
                    Object.values(files).map(async (file) => {
                        const data = new FormData();
                        data.append("file", file);
                        data.append("upload_preset", "upload");

                        const uploadRes = await axios.post(
                            "https://api.cloudinary.com/v1_1/dmxzcafrn/image/upload",
                            data,
                            { withCredentials: false }
                        );

                        const { url } = uploadRes.data;
                        return url;
                    })
                );
            }

            newEntry = {
                ...info,
                author: user._id,
                photos: list
            };

            const response = await axios.post(
                'http://localhost:5500/api/entries/',
                newEntry,
                { withCredentials: false }
            );

            navigate(`/view/${response?.data?._id}`);
        } catch (err) {
            console.log("Error creating entry:", err);
            alert("Failed to create entry. Check console for details.");
        }
    }

    return (
        <div className='create'>
            <Navbar />
            <div className="createContainer">

                <div className="picsContainer">
                    <div className="formInput">
                        <h2>Upload Images (Max 3)</h2>
                        <label htmlFor="file">
                            <FontAwesomeIcon className="icon" icon={faPlusCircle} />
                        </label>
                        <input
                            type="file"
                            id="file"
                            multiple
                            accept="image/*"
                            onChange={(e) => setFiles(e.target.files)}
                            style={{ display: "none" }}
                        />
                    </div>

                    <div className="uploadedPictures">
                        {[0, 1, 2].map((index) => (
                            <div className="upload_pic" key={index}>
                                <img
                                    src={
                                        files && files[index]
                                            ? URL.createObjectURL(files[index])
                                            : ""
                                    }
                                    alt=""
                                    height="80px"
                                />
                            </div>
                        ))}
                    </div>
                </div>

                <div className="input">
                    <label htmlFor="title">Title</label>
                    <input
                        onChange={handleChange}
                        type="text"
                        id="title"
                        placeholder="Enter Title"
                    />
                </div>

                <div className="input">
                    <label htmlFor="location">Location</label>
                    <input
                        onChange={handleChange}
                        type="text"
                        id="location"
                        placeholder="Enter Location"
                    />
                </div>

                <div className="input">
                    <label htmlFor="date">Date</label>
                    <input
                        onChange={handleChange}
                        type="date"
                        id="date"
                        placeholder="Choose Date"
                    />
                </div>

                <div className="input">
                    <label htmlFor="text">Write your thoughts...</label>
                    <textarea
                        id="text"
                        cols="150"
                        rows="25"
                        onChange={handleChange}
                        autoFocus
                        placeholder="Your travel experience..."
                    ></textarea>
                </div>

                <button className='createBtn' onClick={handleClick}>
                    Create Entry
                </button>
            </div>
        </div>
    );
}

export default Create;
